import React ,{UseContext, useContext} from "react";
import { BookContext } from "../contexts/BookContext";


const Navbar = () =>{
    const {books} = useContext(BookContext);


    return(
        <div>
            <h1>You have {books.length} books to read</h1>
        </div>
    )
}





export default Navbar
